import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './components/Home';
import Login from './components/Login';
import AboutUs from './components/AboutUs';
import Packages from './components/Packages';
import PurchasePackages from './components/PurchasePackages';
import Register from './components/Register';
import Profile from './components/Profile';
import EventPage from './components/EventPage';
import Navbar from "./components/Navbar";
import Cookies from 'js-cookie';
import axios from "axios";

function App(){

        return (
            <Router>
                <Navbar logOut={logOut} logged={isLoggedIn}/>
                <Routes>
                    <Route path="/" element={<Home />} />
                    <Route path="/login" element={<Login updateLogged={updateLogged} />} />
                    <Route path="/about-us" element={<AboutUs />} />
                    <Route path="/packages" element={<Packages />} />
                    <Route path="/purchase-packages" element={<PurchasePackages />} />
                    <Route path="/profile" element={<Profile />} />
                    <Route path="/event/:id" element={<EventPage />} />

                </Routes>
            </Router>
        )

}

export default App;
